import PropTypes from 'prop-types'
const Button = (props) => {
  return (
    <button className={`btn ${props.bgcolor ? 'btn-' + props.bgcolor : ''}`}>
      {props.text}
    </button>
  )
}

Button.propTypes = {
  text: propTypes.string,
  bgcolor: propTypes.string,
}

export default Button
